import React from "react"

import { ProductsBlock, SearchHeader } from './index'

function AboutProducts({items}) {

  return (
    <div>
        <SearchHeader name={items.name}/>
      <div className="block-cards">
          {
            items.map((obj) => 
            <div>
              <h1>{obj.category}</h1>
              {obj.products.map((product) => (<ProductsBlock 
            key = {obj.id}
            {...obj}/>))}
            </div>)
          }
      </div>
    </div>
  )
}

export default AboutProducts
